      <div className="min-h-screen w-full min-w-[390px] bg-blurry-shapes bg-cover bg-center bg-no-repeat overflow-x-auto">
        <div className="pr-4 pl-4">
          <Navbar />
        </div>
        <ChatPage />
      </div>
    </div>
  );
}

export default App;
